import React, { Component } from "react";
import { Link } from "react-router-dom";

import { fetchUserRentals } from "../../actions/";
import { connect } from "react-redux";

class RentalManage extends Component {
  constructor(props) {
    super(props);

    this.state = {
      userRentals: [],
      errors: [],
      isFetching: false
    };
  }

  componentDidMount() {
    this.props.fetchUserRentals();
  }

  render() {
    const { isAuthenticated } = this.props.auth;
    const { userRentals } = this.state;
    const { rentals } = this.props;

    return (
      <div>
        {isAuthenticated && (
          <section id="userRentals">
            <h1 className="page-title">My Rentals</h1>
            <div className="row">
              {rentals.map((rental, i) => (
                // <p key={i}>{rental.title}</p>
                <div className="col-md-4">
                  <div className="card text-center">
                    <div className="card-block">
                      <h4 className="card-title">Rental Title - Rental City</h4>
                      <Link className="btn btn-bwm" to="rental detail page">
                        Go to Rental
                      </Link>
                      <button className="btn btn-bwm"> Bookings </button>
                    </div>
                    <div className="card-footer text-muted">
                      Created at 2018/04/04
                    </div>
                  </div>
                </div>
              ))}
            </div>
          </section>
        )}

        <div className="alert alert-warning">
          You dont have any rentals currenty created. If you want advertised
          your property please follow this link.
          <Link
            style={{ marginLeft: "10px" }}
            className="btn btn-bwm"
            to="create form"
          >
            Register Rental
          </Link>
        </div>
      </div>
    );
  }
}

const mapStateToProps = state => ({
  auth: state.auth,
  rentals: state.rentals.rentals
});

export default connect(mapStateToProps, { fetchUserRentals })(RentalManage);
